acer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"metadata\":{\"name\":\"Content\"},\"align\":\"wide\",\"style\":{\"spacing\":{\"blockGap\":\"var:preset|spacing|40\"}},\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group alignwide\"><!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"40%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:40%\"><!-- wp:heading {\"fontSize\":\"large\"} -->\n<h2 class=\"wp-block-heading has-large-font-size\">Instalación</h2>\n<!-- /wp:heading --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Disfruta de la tranquilidad con nuestros servicios de instalación y configuración profesional. Desde sistemas de cine en casa hasta dispositivos de hogar inteligente, nos aseguraremos de que todo esté instalado y configurado correctamente para un rendimiento óptimo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#\">Descubre más</a></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:separator {\"align\":\"wide\",\"style\":{\"color\":{\"background\":\"#4747471a\"}},\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator alignwide has-text-color has-alpha-channel-opacity has-background is-style-wide\" style=\"background-color:#4747471a;color:#4747471a\"/>\n<!-- /wp:separator -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"40%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:40%\"><!-- wp:heading {\"fontSize\":\"large\"} -->\n<h2 class=\"wp-block-heading has-large-font-size\">Mantenimiento</h2>\n<!-- /wp:heading --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Extiende la vida útil de tus dispositivos electrónicos con nuestros servicios de reparación y mantenimiento. Nuestros técnicos cualificados diagnosticarán y solucionarán cualquier problema para que tus dispositivos funcionen sin problemas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#\">Descubre más</a></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:separator {\"align\":\"wide\",\"style\":{\"color\":{\"background\":\"#4747471a\"}},\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator alignwide has-text-color has-alpha-channel-opacity has-background is-style-wide\" style=\"background-color:#4747471a;color:#4747471a\"/>\n<!-- /wp:separator -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"40%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:40%\"><!-- wp:heading {\"fontSize\":\"large\"} -->\n<h2 class=\"wp-block-heading has-large-font-size\">Intercambio</h2>\n<!-- /wp:heading --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Actualiza a la última tecnología mientras cuidas del medio ambiente con nuestros programas de intercambio y reciclaje. Intercambia tus dispositivos antiguos por crédito para nuevas compras o recíclalos de manera responsable con nosotros.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#\">Descubre más</a></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:separator {\"align\":\"wide\",\"style\":{\"color\":{\"background\":\"#4747471a\"}},\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator alignwide has-text-color has-alpha-channel-opacity has-background is-style-wide\" style=\"background-color:#4747471a;color:#4747471a\"/>\n<!-- /wp:separator -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"40%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:40%\"><!-- wp:heading {\"fontSize\":\"large\"} -->\n<h2 class=\"wp-block-heading has-large-font-size\">Atención al cliente</h2>\n<!-- /wp:heading --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Saca el máximo provecho de tus dispositivos electrónicos con nuestros servicios de soporte técnico y formación. Nuestros expertos te ayudarán a resolver cualquier problema y te darán consejos sobre cómo usar tus dispositivos de manera efectiva.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"#\">Descubre más</a></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:separator {\"align\":\"wide\",\"style\":{\"color\":{\"background\":\"#4747471a\"}},\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator alignwide has-text-color has-alpha-channel-opacity has-background is-style-wide\" style=\"background-color:#4747471a;color:#4747471a\"/>\n<!-- /wp:separator --></div>\n<!-- /wp:group -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:25:\"_dotcom_imported_services\";a:3:{s:4:\"slug\";s:25:\"_dotcom_imported_services\";s:5:\"title\";s:25:\"_dotcom_imported_services\";s:11:\"description\";s:0:\"\";}}s:24:\"virtual_theme_categories\";a:0:{}s:4:\"tags\";a:0:{}s:12:\"pattern_meta\";a:0:{}s:10:\"source_url\";s:81:\"https://wooblockpatterns.wpcomstaging.com/2024/07/02/headings-left-content-right/\";s:13:\"modified_date\";s:19:\"2024-07-02 11:17:53\";s:12:\"preview_data\";a:0:{}s:9:\"post_type\";s:8:\"wp_block\";s:22:\"is_included_in_big_sky\";i: