n elegantes, sino que también están hechos para durar, asegurando años de disfrute y uso. Creemos en una moda que no solo se ve bien, sino que también hace el bien por el planeta y sus habitantes. Por eso estamos dedicados a reducir el impacto ambiental y social de la industria de la ropa y los accesorios. Cuando compras con nosotros, puedes sentirte seguro sabiendo que tu compra apoya un enfoque más sostenible y ético de la moda, haciendo una diferencia positiva en el mundo.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:22:\"_dotcom_imported_about\";a:3:{s:4:\"slug\";s:22:\"_dotcom_imported_about\";s:5:\"title\";s:22:\"_dotcom_imported_about\";s:11:\"description\";s:0:\"\";}}s:24:\"virtual_theme_categories\";a:0:{}s:4:\"tags\";a:0:{}s:12:\"pattern_meta\";a:0:{}s:10:\"source_url\";s:75:\"https://wooblockpatterns.wpcomstaging.com/2024/07/01/right-aligned-content/\";s:13:\"modified_date\";s:19:\"2024-07-01 16:23:24\";s:12:\"preview_data\";a:0:{}s:9:\"post_type\";s:8:\"wp_block\";s:22:\"is_included_in_big_sky\";i:0;}i:31;a:18:{s:2:\"ID\";i:306;s:7:\"site_id\";i:231214916;s:5:\"title\";s:44:\"Encabezado grande con contenido a la derecha\";s:4:\"name\";s:39:\"large-heading-with-content-on-the-right\";s:11:\"description\";s:0:\"\";s:14:\"ai_description\";s:0:\"\";s:4:\"html\";s:3452:\"<!-- wp:group {\"metadata\":{\"name\":\"About\"},\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"calc( 0.5 * var(\\u002d\\u