estination\":\"none\",\"style\":{\"color\":[]}} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/e7e21c3e64f977311b55a59d66aec660.jpeg\" alt=\"\" class=\"wp-image-285\" style=\"aspect-ratio:4/3;object-fit:cover\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group -->\n\n<!-- wp:heading {\"level\":3,\"fontSize\":\"large\"} -->\n<h3 class=\"wp-block-heading has-large-font-size\">Compromiso con la sostenibilidad</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>En el corazón de nuestra misión está un compromiso con la sostenibilidad. Priorizamos prácticas respetuosas con el medio ambiente al obtener productos cultivados localmente, minimizar los residuos de embalaje y promover métodos de agricultura sostenible.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:group {\"style\":{\"spacing\":{\"margin\":{\"bottom\":\"10px\"}}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\" style=\"margin-bottom:10px\"><!-- wp:image {\"id\":273,\"aspectRatio\":\"4/3\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"color\":[]}} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/44024b9b9c88dd50f5cf11f5c31311c5-1.jpeg\" alt=\"\" class=\"wp-image-273\" style=\"aspect-ratio:4/3;object-fit:cover\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group -->\n\n<!-- wp:heading {\"level\":3,\"fontSize\":\"large\"} -->\n<h3 class=\"wp-block-heading has-large-font-size\">Calidad y frescura</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Cada paso de nuestro proceso, desde la meticulosa elección de ingredientes hasta la adherencia a estándares rigurosos, refleja nuestra dedicación a la calidad. Desde la cosecha inicial hasta el producto terminado, mantenemos estándares intransigentes de frescura y sabor.</p>\