\n<h2 class=\"wp-block-heading\">Descubre un mundo de posibilidades</h2>\n<!-- /wp:heading --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"55%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:55%\"><!-- wp:spacer {\"height\":\"var:preset|spacing|20\"} -->\n<div style=\"height:var(--wp--preset--spacing--20)\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p>Creemos que tu hogar debería ser un reflejo de tu estilo y personalidad únicos. Nuestra colección seleccionada de esenciales para el hogar y piezas de decoración está diseñada para ayudarte a crear un espacio que se sienta verdaderamente Me gusta tú.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nuestros diseñadores expertos trabajarán codo a codo contigo para hacer realidad tu visión. Desde la elección de muebles hasta la combinación de colores, te ofreceremos asesoramiento y orientación Profesional en cada paso del camino para ayudarte a lograr el equilibrio perfecto entre comodidad, funcionalidad y atractivo estético.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:22:\"_dotcom_imported_about\";a:3:{s:4:\"slug\";s:22:\"_dotcom_imported_about\";s:5:\"title\";s:22:\"_dotcom_imported_about\";s:11:\"description\";s:0:\"\";}}s:24:\"virtual_theme_categories\";a:0:{}s:4:\"tags\";a:0:{}s:12:\"pattern_meta\";a:0:{}s:10:\"source_url\";s:84:\"https://wooblockpatterns.wpcomstaging.com/2024