(248, 1, '2025-01-25 20:06:57', '2025-01-25 19:06:57', '<img class=\"alignnone size-full wp-image-202\" src=\"https://master-mari-angeles-estepa.test/wp-content/uploads/2025/01/highxtar-mad-cool-festival-2025-1440x1080-1.jpg\" alt=\"Mad Cool 2025\" width=\"1440\" height=\"1080\" />\r\n\r\nEl Mad Cool Festival 2025 se celebrará del 10 al 13 de julio en el recinto Iberdrola Music, ubicado en el distrito de Villaverde, Madrid. Este evento se ha consolidado como uno de los festivales más destacados de Europa, atrayendo a amantes de la música de todo el mundo.\r\n<h2>Cartel por días:</h2>\r\n<h3>Jueves, 10 de julio:</h3>\r\nKings of Leon\r\nGracie Abrams\r\nIggy Pop\r\nWeezer\r\nThe Backseat Lovers\r\nMother Mother\r\nThe Wombats\r\nRoyel Otis\r\nBlondshell\r\nCirca Waves\r\nBad Nerves\r\nGeordie Greep\r\nDeadletter\r\nJehu\r\nHannah Grae\r\nMiss Monique\r\nMyd\r\nChloé Caillet\r\n<h3>Viernes, 11 de julio:</h3>\r\nNine Inch Nails\r\nNoah Kahan\r\nAlanis Morissette\r\nBenson Boone\r\nFoster The People\r\nJet\r\nKaiser Chiefs\r\nArtemas\r\nFlaurese\r\nMichelle\r\nMorgxn\r\nThe Blessed Madonna\r\nNamasenda\r\nKrystal Klear\r\nPole Position\r\nSábado, 12 de julio:\r\n\r\nOlivia Rodrigo\r\nJustice\r\nArde Bogotá\r\nThirty Seconds to Mars\r\nSt. Vincent\r\nGlass Animals\r\nGirl in Red\r\nRenforshort\r\nBloc Party\r\nFinneas\r\nThe Driver Era\r\nThe Snuts\r\nThe Amazons\r\nKingfishr\r\n<h3>Domingo, 13 de julio:</h3>\r\nBrunch Electronik x Mad Cool\r\nUna jornada dedicada exclusivamente a la música electrónica, en colaboración con Brunch Electronik, que promete una clausura espectacular con los mejores DJs internacionales del momento.\r\nEntradas:\r\n\r\nAbonos generales: Desde 199 euros.\r\nEntradas de día: Disponibles a partir del 27 de enero, con precios desde 89 euros más gastos.\r\nEntradas para la jornada electrónica del domingo: Se venderán por separado.\r\nLas entradas estarán disponibles en preventa a partir del 24 de enero en Santander SMusic y Mad Cool tickets.\r\n\r\nEl Mad Cool Festival 2025 promete ser una experiencia inolvidable, combinando una selección de artistas de renombre internacional con una producción de alta calidad en un entorno vibrante. Se recomienda a los interesados adquirir sus entradas con anticipación y mantenerse informados a través de los canales oficiales del festival para cualquier actualización.', 'Mad Cool 2025', '', 'inherit', 'closed', 'closed', '', '198-revision-v1', '', '', '2025-01-25 20:06:57', '2025-01-25 19:06:57', '', 198, 'https://master-mari-angeles-estepa.test/?p=248', 0, 'revision', '', 0),
