ravés de los canales oficiales del festival para conocer las últimas novedades y posibles actualizaciones.', 'Granada Sound 2025', '', 'inherit', 'closed', 'closed', '', '183-revision-v1', '', '', '2025-02-02 20:59:36', '2025-02-02 19:59:36', '', 183, 'https://master-mari-angeles-estepa.test/?p=343', 0, 'revision', '', 0),
