(354, 1, '2025-02-02 21:31:16', '2025-02-02 20:31:16', 'El Granada Sound 2025 se celebrará los días 12 y 13 de septiembre en el Cortijo del Conde, Granada. Este festival es reconocido por reunir a destacados artistas del panorama musical español, ofreciendo una experiencia única para los amantes de la música en un entorno incomparable.\r\n<h2>Cartel de Artistas Confirmados:</h2>\r\n<h3>Viernes, 12 de septiembre:</h3>\r\nMikel Izal\r\nZahara\r\nXoel López\r\nMiss Caffeina\r\nVeintiuno\r\nNiña Polaca\r\nKaravana\r\nPaula Mattheus\r\nBarry B.\r\n<h3><strong>Sábado, 13 de septiembre:</strong></h3>\r\nViva Suecia\r\nOjete Calor\r\nSiloé\r\nDorian\r\nSamuraï\r\nBesmaya\r\nCarlos Ares\r\nMafalda Cardenal\r\nMelifluo\r\n\r\nLas entradas ya están disponibles para su compra. El abono general, que permite el acceso a ambos días del festival, tiene un precio desde 65€ (gastos de gestión incluidos). Además, existen entradas de día disponibles desde 50€ (gastos de gestión incluidos), ideales para quienes deseen asistir solo una jornada. Es importante destacar que las entradas son limitadas, por lo que se recomienda adquirirlas con antelación.\r\n\r\nPara facilitar la experiencia de los asistentes, el festival implementará un sistema de pago mediante pulseras recargables. Al recargar la pulsera antes del evento, los asistentes pueden obtener saldo adicional gratuito para consumir en comida, bebida y productos de las marcas colaboradoras. Por ejemplo, al recargar 50€, se obtienen 5€ adicionales de forma gratuita.\r\n\r\nEl Cortijo del Conde, ubicado en Granada, es el lugar elegido para este evento. Este espacio ha sido sede de ediciones anteriores del festival, ofreciendo un entorno adecuado para disfrutar de la música en vivo.\r\n\r\nEl Granada Sound 2025 promete ser una cita ineludible para los amantes de la música, combinando actuaciones de artistas consagrados y emergentes en un ambiente vibrante y festivo. Se recomienda a los interesados mantenerse informados a través de los canales oficiales del festival para conocer las últimas novedades y posibles actualizaciones.', 'Granada Sound 2025', '', 'inherit', 'closed', 'closed', '', '183-revision-v1', '', '', '2025-02-02 21:31:16', '2025-02-02 20:31:16', '', 183, 'https://master-mari-angeles-estepa.test/?p=354', 0, 'revision', '', 0),
(355, 1, '2025-02-02 21:32:06', '2025-02-02 20:32:06', 'El Mad Cool Festival 2025 se celebrará del 10 al 13 de julio en el recinto Iberdrola Music, ubicado en el distrito de Villaverde, Madrid. Este evento se ha consolidado como uno de los festivales más destacados de Europa, atrayendo a amantes de la música de todo el mundo.\r\n<h2>Cartel por días:</h2>\r\n<h3>Jueves, 10 de julio:</h3>\r\nKings of Leon\r\nGracie Abrams\r\nIggy Pop\r\nWeezer\r\nThe Backseat Lovers\r\nMother Mother\r\nThe Wombats\r\nRoyel Otis\r\nBlondshell\r\nCirca Waves\r\nBad Nerves\r\nGeordie Greep\r\nDeadletter\r\nJehu\r\nHannah Grae\r\nMiss Monique\r\nMyd\r\nChloé Caillet\r\n<h3>Viernes, 11 de julio:</h3>\r\nNine Inch Nails\r\nNoah Kahan\r\nAlanis Morissette\r\nBenson Boone\r\nFoster The People\r\nJet\r\nKaiser Chiefs\r\nArtemas\r\nFlaurese\r\nMichelle\r\nMorgxn\r\nThe Blessed Madonna\r\nNamasenda\r\nKrystal Klear\r\nPole Position\r\nSábado, 12 de julio:\r\n\r\nOlivia Rodrigo\r\nJustice\r\nArde Bogotá\r\nThirty Seconds to Mars\r\nSt. Vincent\r\nGlass Animals\r\nGirl in Red\r\nRenforshort\r\nBloc Party\r\nFinneas\r\nThe Driver Era\r\nThe Snuts\r\nThe Amazons\r\nKingfishr\r\n<h3>Domingo, 13 de julio:</h3>\r\nBrunch Electronik x Mad Cool\r\nUna jornada dedicada exclusivamente a la música electrónica, en colaboración con Brunch Electronik, que promete una clausura espectacular con los mejores DJs internacionales del momento.\r\nEntradas:\r\n\r\nAbonos generales: Desde 199 euros.\r\nEntradas de día: Disponibles a partir del 27 de enero, con precios desde 89 euros más gastos.\r\nEntradas para la jornada electrónica del domingo: Se venderán por separado.\r\nLas entradas estarán disponibles en preventa a partir del 24 de enero en Santander SMusic y Mad Cool tickets.\r\n\r\nEl Mad Cool Festival 2025 promete ser una experiencia inolvidable, combinando una selección de artistas de renombre internacional con una producción de alta calidad en un entorno vibrante. Se recomienda a los interesados adquirir sus entradas con anticipación y mantenerse informados a través de los canales oficiales del festival para cualquier actualización.', 'Mad Cool 2025', '', 'inherit', 'closed', 'closed', '', '198-revision-v1', '', '', '2025-02-02 21:32:06', '2025-02-02 20:32:06', '', 198, 'https://master-mari-angeles-estepa.test/?p=355', 0, 'revision', '', 0),
