(509, 1, '2025-05-11 11:34:09', '2025-05-11 09:34:09', '<p class=\"\" data-start=\"163\" data-end=\"599\">Renueva tu armario con esta camiseta de tirantes versátil y ligera, ideal para los días de calor o para combinar en looks más relajados. Confeccionada en un tejido suave y transpirable, se adapta perfectamente al cuerpo sin perder comodidad. Su diseño minimalista la convierte en la prenda perfecta tanto para el día a día como para actividades al aire libre o en casa.</p>\r\n\r\n<ul data-start=\"601\" data-end=\"789\">\r\n 	<li class=\"\" data-start=\"601\" data-end=\"678\">\r\n<p class=\"\" data-start=\"603\" data-end=\"678\">Tejido: Algodón suave / mezcla con elastano (ajustar según material real)</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"679\" data-end=\"732\">\r\n<p class=\"\" data-start=\"681\" data-end=\"732\">Corte: Entallado / holgado (ajustar según diseño)</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"733\" data-end=\"756\">\r\n<p class=\"\" data-start=\"735\" data-end=\"756\">Tallas: S, M, L, XL</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"757\" data-end=\"789\">\r\n<p class=\"\" data-start=\"759\" data-end=\"789\">Disponible en varios colores</p>\r\n</li>\r\n</ul>\r\n<p class=\"\" data-start=\"791\" data-end=\"913\">Atrévete a combinarla con tus jeans favoritos o debajo de una chaqueta ligera. ¡Una prenda imprescindible en tu colección!</p>', 'Camiseta de tirantes', '<strong data-start=\"54\" data-end=\"78\">Camiseta de Tirantes</strong><br data-start=\"78\" data-end=\"81\" />Ligera, cómoda y perfecta para el día a día. Su tejido suave y transpirable la hace ideal para el verano o para combinar en capas. Disponible en varios colores y tallas.', 'publish', 'open', 'closed', '', 'camiseta-tirantes', '', '', '2025-06-22 18:42:27', '2025-06-22 16:42:27', '', 0, 'https://master-mari-angeles-estepa.test/?post_type=product&#038;p=509', 0, 'product', '', 2),
(511, 1, '2025-06-22 18:42:45', '2025-06-22 16:42:45', '<p class=\"\" data-start=\"163\" data-end=\"599\">Renueva tu armario con esta camiseta de tirantes versátil y ligera, ideal para los días de calor o para combinar en looks más relajados. Confeccionada en un tejido suave y transpirable, se adapta perfectamente al cuerpo sin perder comodidad. Su diseño minimalista la convierte en la prenda perfecta tanto para el día a día como para actividades al aire libre o en casa.</p>\r\n\r\n<ul data-start=\"601\" data-end=\"789\">\r\n 	<li class=\"\" data-start=\"601\" data-end=\"678\">\r\n<p class=\"\" data-start=\"603\" data-end=\"678\">Tejido: Algodón suave / mezcla con elastano (ajustar según material real)</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"679\" data-end=\"732\">\r\n<p class=\"\" data-start=\"681\" data-end=\"732\">Corte: Entallado / holgado (ajustar según diseño)</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"733\" data-end=\"756\">\r\n<p class=\"\" data-start=\"735\" data-end=\"756\">Tallas: S, M, L, XL</p>\r\n</li>\r\n 	<li class=\"\" data-start=\"757\" data-end=\"789\">\r\n<p class=\"\" data-start=\"759\" data-end=\"789\">Disponible en varios colores</p>\r\n</li>\r\n</ul>\r\n<p class=\"\" data-start=\"791\" data-end=\"913\">Atrévete a combinarla con tus jeans favoritos o debajo de una chaqueta ligera. ¡Una prenda imprescindible en tu colección!</p>', 'Camiseta de tirantes', '<strong data-start=\"54\" data-end=\"78\">Camiseta de Tirantes</strong><br data-start=\"78\" data-end=\"81\" />Ligera, cómoda y perfecta para el día a día. Su tejido suave y transpirable la hace ideal para el verano o para combinar en capas. Disponible en varios colores y tallas.', 'inherit', 'closed', 'closed', '', '509-autosave-v1', '', '', '2025-06-22 18:42:45', '2025-06-22 16:42:45', '', 509, 'https://master-mari-angeles-estepa.test/?p=511', 0, 'revision', '', 0),
